  true,\n\t\"url\": null,\n\t\"notes\": \"The Global Human Influence Index Dataset
  of the Last of the Wild Project, Version 2, 2005 (LWP-2) is a global dataset of
  1-kilometer grid cells, created from nine global data layers covering human population
  pressure (population density), human land use and infrastructure (built-up areas,
  nighttime lights, land use/land cover), and human access (coastlines, roads, railroads,
  navigable rivers). The dataset is produced by the Wildlife Conservation Society
  (WCS) and the Columbia University Center for International Earth Science Information
  Network (CIESIN) and is and is available in the Interrupted Goode Homolosine Projection
  (IGHP) system.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
